var threeSumClosest = function(nums, target) {
    nums.sort((a,b)=>a-b)
    const len = nums.length
    let res = nums[0] + nums[1] + nums[len-1]
    for(let i = 0; i < len-2;i++){
      let left = i + 1
      let right = len-1
      while(left < right){
        let sum = nums[i] + nums[left] + nums[right]
        if(sum > target){
          right--
        }else{
          left++
        }
        //\u66F4\u65B0\u6700\u5C0F\u548C
        if(Math.abs(res-target) > Math.abs(sum-target)){
          res = sum
        }
      }
    }
    return res
  };



/**
 * @param {number[]} nums
 * @param {number} target
 * @param {number[]} helpArr
 * @return {number}
 */
var threeSumClosest = function(nums, target,helpArr=[]) {
  nums.sort((a,b)=>a-b)
  let len = nums.length
  for(let i = 0; i < len-1;i++){
    let left = i + 1
    let right = len-1
    while(left < right){
      let sum = nums[i] + nums[left] + nums[right]
      sum >= target ? (helpArr[sum-target] = sum ,right--) : (helpArr[target-sum] = sum,left++)
    }
  }
  return helpArr.find( v => v !== undefined)
}
