`,paraId:17,tocIndex:8},{value:"\u524D\u5E8F\u904D\u5386",paraId:18,tocIndex:10},{value:`// \u8FED\u4EE3\u6CD5\uFF08\u6808\u6A21\u62DF\u524D\u5E8F\u904D\u5386\uFF09
function invertTree(root: TreeNode | null): TreeNode | null {
    let helperStack: TreeNode[] = [];
    let curNode: TreeNode,
        tempNode: TreeNode | null;
    if (root !== null) helperStack.push(root);
    while (helperStack.length > 0) {
        curNode = helperStack.pop()!;
        // \u5165\u6808\u64CD\u4F5C\u6700\u597D\u5728\u4EA4\u6362\u8282\u70B9\u4E4B\u524D\u8FDB\u884C\uFF0C\u4FBF\u4E8E\u7406\u89E3
        if (curNode.right) helperStack.push(curNode.right);
        if (curNode.left) helperStack.push(curNode.left);
        tempNode = curNode.left;
        curNode.left = curNode.right;
        curNode.right = tempNode;
    }
    return root;
};
`,paraId:19,tocIndex:10},{value:"\u4E2D\u5E8F\u904D\u5386",paraId:20,tocIndex:10},{value:`// \u8FED\u4EE3\u6CD5\uFF08\u6808\u6A21\u62DF\u4E2D\u5E8F\u904D\u5386-\u7EDF\u4E00\u5199\u6CD5\u5F62\u5F0F\uFF09
function invertTree(root: TreeNode | null): TreeNode | null {
    let helperStack: (TreeNode | null)[] = [];
    let curNode: TreeNode | null,
        tempNode: TreeNode | null;
    if (root !== null) helperStack.push(root);
    while (helperStack.length > 0) {
        curNode = helperStack.pop();
        if (curNode !== null) {
            if (curNode.right !== null) helperStack.push(curNode.right);
            helperStack.push(curNode);
            helperStack.push(null);
            if (curNode.left !== null) helperStack.push(curNode.left);
        } else {
            curNode = helperStack.pop()!;
            tempNode = curNode.left;
            curNode.left = curNode.right;
            curNode.right = tempNode;
        }
    }
    return root;
};
`,paraId:21,tocIndex:10},{value:"\u540E\u5E8F\u904D\u5386",paraId:22,tocIndex:10},{value:`// \u8FED\u4EE3\u6CD5\uFF08\u6808\u6A21\u62DF\u540E\u5E8F\u904D\u5386-\u7EDF\u4E00\u5199\u6CD5\u5F62\u5F0F\uFF09
function invertTree(root: TreeNode | null): TreeNode | null {
    let helperStack: (TreeNode | null)[] = [];
    let curNode: TreeNode | null,
        tempNode: TreeNode | null;
    if (root !== null) helperStack.push(root);
    while (helperStack.length > 0) {
        curNode = helperStack.pop();
        if (curNode !== null) {
            helperStack.push(curNode);
            helperStack.push(null);
            if (curNode.right !== null) helperStack.push(curNode.right);
            if (curNode.left !== null) helperStack.push(curNode.left);
        } else {
            curNode = helperStack.pop()!;
            tempNode = curNode.left;
            curNode.left = curNode.right;
            curNode.right = tempNode;
        }
    }
    return root;
};

`,paraId:23,tocIndex:10},{value:"\u5C42\u5E8F\u904D\u5386",paraId:24,tocIndex:10},{value:`// \u8FED\u4EE3\u6CD5\uFF08\u961F\u5217\u6A21\u62DF\u5C42\u5E8F\u904D\u5386\uFF09
function invertTree(root: TreeNode | null): TreeNode | null {
    const helperQueue: TreeNode[] = [];
    let curNode: TreeNode,
        tempNode: TreeNode | null;
    if (root !== null) helperQueue.push(root);
    while (helperQueue.length > 0) {
        for (let i = 0, length = helperQueue.length; i < length; i++) {
            curNode = helperQueue.shift()!;
            tempNode = curNode.left;
            curNode.left = curNode.right;
            curNode.right = tempNode;
            if (curNode.left !== null) helperQueue.push(curNode.left);
            if (curNode.right !== null) helperQueue.push(curNode.right);
        }
    }
    return root;
};

